import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Contact = () => {
  const [, setContext] = useState(null);

  useEffect(() => {
    axios.get('http://127.0.0.1:8000/api/my_context/')
      .then(response => setContext(response.data.my_info))
      .catch(error => console.error('Error fetching context:', error));
  }, []);

  return (
    <div>
      <h1>Contact Page</h1>
      <p>{context.my_title}</p>
    </div>
  );
};

export default Contact;
